/*
 * 134. 加油站		url: https://leetcode.cn/problems/gas-station/
 *
 * 题目描述：在一条环路上有 n 个加油站，其中第 i 个加油站有汽油 gas[i] 升。
 * 你有一辆油箱容量无限的的汽车，从第 i 个加油站开往第 i+1 个加油站需要消耗汽油 cost[i] 升。
 * 你从其中的一个加油站出发，开始时油箱为空。
 * 给定两个整数数组 gas 和 cost ，如果你可以按顺序绕环路行驶一周，则返回出发时加油站的编号，
 * 否则返回 -1 。如果存在解，则 保证 它是 唯一 的。
 * */

#include <iostream>
#include <vector>
#include <algorithm>
using namespace std;

class Solution
{
 public:
	int canCompleteCircuit(vector<int>& gas, vector<int>& cost)
	{
		for (int i = 0; i < gas.size(); i++)
		{
			if (gas[i] > 0 && gas[i] - cost[i] >= 0)
			{
				// 有剩油的加油站就统计
				int res_gas = 0;
				for (int j = i; j < (gas.size() + i); ++j)
				{
					res_gas += gas[j % gas.size()] - cost[j % gas.size()];

					// 无法完成
					if (res_gas < 0)
					{
						// 就从下一个加油站开始重新尝试
						i = j;
						break;
					}
				}

				if (res_gas >= 0)	return i;
			}
		}

		return -1;
	}
};

